(51, 'Md. Al-Amin', 'Tanvir', '1653298078-default.png', 2, 333, 0, 1, 1, 2, 2, 3, 562, 456, 1, 'Panel made of 40x40x1,5 horizontal sections and vertical sections', 'কাজী নজরুল ইসলাম (২৪ মে[টীকা ১][১] ১৮৯৯ – ২৯ আগস্ট ১৯৭৬; ১১ জ্যৈষ্ঠ ১৩০৬ – ১২ ভাদ্র ১৩৮৩ বঙ্গাব্দ)', 'Panel made of 40x40x1,5 horizontal sections and vertical sections diameter 25×1,5 mm ep random implementation. Rapid assembly without welding.', 'জীবন শুরু হয়েছিল অকিঞ্চিতকর পরিবেশে। স্কুলের গণ্ডি পার হওয়ার আগেই ১৯১৭ খ্রিস্টাব্দে তিনি ব্রিটিশ ভারতীয় সেনাবাহিনীতে যোগ দিয়েছিলেন। মুসলিম পরিবারের সন্তান এবং শৈশবে ইসলামী শিক্ষায় দীক্ষিত হয়েও তিনি বড়', 'Panel made of 40x40x1,5 horizontal sections and vertical sections diameter 25×1,5 mm ep random implementation. Rapid assembly without welding.\r\n\r\nØ60x2mm or Ø60x3mm steel-plated posts, depending on height. Polypropylene cap which is not degradeable by the weather elements.', 'কাজী নজরুল ইসলাম (২৪ মে[টীকা ১][১] ১৮৯৯ – ২৯ আগস্ট ১৯৭৬; ১১ জ্যৈষ্ঠ ১৩০৬ – ১২ ভাদ্র ১৩৮৩ বঙ্গাব্দ) বিংশ শতাব্দীর প্রধান বাঙালি কবি ও সঙ্গীতকার। তার মাত্র ২৩ বৎসরের সাহিত্যিক জীবনে সৃষ্টির যে প্রাচুর্য তা তুলনারহিত। সাহিত্যের নানা শাখায় বিচরণ করলেও তার প্রধান পরিচয় তিনি কবি।', '2022-05-23 03:27:58', '2022-05-23 03:27:58');
